(1, 'Explica de manera clara los contenidos de la asignatura', 1),
(2, 'Relaciona los contenidos de la asignatura con los contenidos de otras', 1),
(3, 'Resuelve las dudas relacionadas con los contenidos de la asignatura', 1),
(4, 'Propone ejemplos o ejercicios que vinculan la asignatura con la práctica profesional', 1),
(5, 'Explica la utilidad de los contenidos teóricos y prácticos para la actividad profesional', 1),
(6, 'Cumple con los acuerdos establecidos al inicio de la asignatura', 2),
(7, 'Durante el curso establece las estrategias adecuadas necesarias para lograr el aprendizaje deseado', 2),
(8, 'El programa presentado al principio de la asignatura se cubre totalmente', 2),
(9, 'Incluye experiencias de aprendizaje en lugares diferentes al aula(talleres, laboratorios, empresa, comunidad, etc', 3),
(10, 'Utiliza para el aprendizaje las herramientas de interacción de las tecnologías actuales de la información (correo electrónico, chats, plataformas, etc', 3),
(11, 'Organiza actividades que me permiten ejercitar mi expresión oral y escrita', 3),
(12, 'Relaciona los contenidos de la asignatura con la industria y la sociedad a nivel local, regional, nacional e internacional. Usa ejemplos y casos relacionados con la vida real', 3),
(13, 'Adapta las actividades para atender los diferentes estilos de aprendizaje de los estudiantes. ', 4),
(14, 'Promueve el autodidactismo y la investigación ', 4),
(15, 'Promueve actividades participativas que me permiten colaborar con mis compañeros con una actitud positiva. ', 4),
(16, 'Estimula la reflexión sobre la manera en que aprendes', 4),
(17, 'Se involucra en las actividades propuestas al grupo', 4),
(18, 'Presenta y expone las clases de manera organizada y estructurada', 4),
(19, 'Utiliza diversas estrategias, métodos, medios y materiales', 4),
(20, 'Muestra compromiso y entusiasmo en sus actividades docentes', 5),
(21, 'Toma en cuenta las necesidades, intereses y expectativas del grupo', 5),
(22, 'Propicia el desarrollo de un ambiente de respeto y confianza', 5),
(23, 'Propicia la curiosidad y el deseo de aprender', 5),
(24, 'Reconoce los éxitos y logros en las actividades de aprendizaje', 5),
(25, 'Nunca toma represalias contra los estudiantes', 5),
(26, 'Hace interesante la asignatura', 5),
(27, 'Identifica los conocimientos y habilidades de los estudiantes al inicio de la asignatura o de cada unidad', 6),
(28, 'Proporciona información para realizar adecuadamente las actividades de evaluación', 6),
(29, 'Toma en cuenta las actividades realizadas y los productos como evidencias para la calificación y acreditación de la asignatura', 6),
(30, 'Considera los resultados de la evaluación (asesorías, trabajos complementarios, búsqueda de información, etc.) para realizar mejoras en el aprendizaje', 6),
(31, 'Da a conocer las calificaciones en el plazo establecido', 6),
(32, 'Da oportunidad de mejorar los resultados de la evaluación del aprendizaje', 6),
(33, 'Muestra apertura para la corrección de errores de apreciación y evaluación', 6),
(34, 'Otorga calificaciones sin favoritismo', 6),
(35, 'Desarrolla la clase en un clima de apertura y entendimiento', 7),
(36, 'Escucha y toma en cuenta las opiniones de los estudiantes', 7),
(37, 'Muestra congruencia entre lo que dice y lo que hace', 7),
(38, 'Asiste a clases regular y puntualmente', 8),
(39, 'Fomenta la importancia de contribuir a la conservación del medio ambiente', 8),
(40, 'Promueve mantener limpias y ordenadas las instalaciones', 8),
(41, 'Es accesible y está dispuesto a brindarte ayuda académica', 8),
(42, 'Emplea las tecnologías de la información y de la comunicación como un medio que facilite el aprendizaje de los estudiantes', 9),
(43, 'Promueve el uso de diversas herramientas, particularmente las digitales, para gestionar (recabar, procesar, evaluar y usar) información', 9),
(44, 'Promueve el uso seguro, legal y ético de la información digital', 9),
(45, 'En general, pienso que es un buen docente', 10),
(46, 'Estoy satisfecha o satisfecho por mi nivel de desempeño y aprendizaje logrado gracias a la labor del docente', 10),
(47, 'Yo recomendaría a este docente', 10);
